// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract UserManagementContract {
    struct User {
        bytes32 name;
        uint256 createdAt;
    }

    mapping(address => User) private users;

    event UserCreated(address indexed _address, bytes32 _name, uint256 _created_at);
    event UserDeleted(address indexed _address);
    event UserUpdated(address indexed _address, bytes32 _name);

    modifier onlyExistingUser() {
        require(users[msg.sender].createdAt > 0, "User does not exist");
        _;
    }

    modifier onlyValidName(bytes32 name) {
        require(name != "", "Invalid name");
        _;
    }

    function destroy() public onlyExistingUser {
        delete users[msg.sender];
        emit UserDeleted(msg.sender);
    }

    function login() public view onlyExistingUser returns (bytes32) {
        return users[msg.sender].name;
    }

    function signup(bytes32 name) public payable onlyValidName(name) returns (bytes32) {
        require(users[msg.sender].createdAt == 0, "User already exists");
        
        users[msg.sender] = User({
            name: name,
            createdAt: block.timestamp
        });
        
        emit UserCreated(msg.sender, name, block.timestamp);
        
        return name;
    }
}
